  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";
import { formToJSON } from "axios";

const router = createBrowserRouter([
  {
    path: "/",
    element: <App />,
    errorElement: < Err404 />

  },
]);

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
